import "../styles/Cart.css";

function Cart() {
  const Freyja = 8;
  const Tyrael = 10;
  const pack = 15;

  return (
    <div className="cart">
      <ul>
        <li>Freyja : {Freyja} €</li>
        <li>Tyrael : {Tyrael} €</li>
        <li>pack : {pack} €</li>
      </ul>

      <p>Total : {Freyja + Tyrael + pack} €</p>
    </div>
  );
}

export default Cart;
